import React, { useState, useEffect } from 'react';
import GoogleSheetsData from './components/GoogleSheetsData';
import './App.css';

function App() {
  const [olympicData, setOlympicData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [sheetUrl, setSheetUrl] = useState('');
  const [showGoogleSheets, setShowGoogleSheets] = useState(false);

  useEffect(() => {
    // This will be replaced with actual Google Sheets API call
    // For now, we'll use sample data
    const sampleData = [
      { name: 'Michael Phelps', country: 'USA', sport: 'Swimming', medals: 28, gold: 23 },
      { name: 'Usain Bolt', country: 'Jamaica', sport: 'Athletics', medals: 8, gold: 8 },
      { name: 'Simone Biles', country: 'USA', sport: 'Gymnastics', medals: 7, gold: 4 },
      { name: 'Carl Lewis', country: 'USA', sport: 'Athletics', medals: 10, gold: 9 },
      { name: 'Larisa Latynina', country: 'Soviet Union', sport: 'Gymnastics', medals: 18, gold: 9 }
    ];
    
    setTimeout(() => {
      setOlympicData(sampleData);
      setLoading(false);
    }, 1000);
  }, []);

  return (
    <>
      <div className="background-overlay"></div>
      <div className="header-overlay"></div>
      <div className="App">
        <header className="olympic-header">
          <img
            src="/olympic-frontend\public\Olympic_rings_without_rims.png"
            alt="Olympics Logo"
            className="olympics-logo"
            style={{ width: '180px', margin: '0 auto', display: 'block' }}
          />
          <h1>Olympic Champions Database</h1>
          <p>Celebrating the Greatest Athletes in Olympic History</p>
        </header>
        <div className="olympic-gallery">
          {[0, 1].map(row =>
            <div className="gallery-row" key={row}>
              {[1, 2, 3, 4].map(col => {
                const num = row * 4 + col;
                return (
                  <div className="gallery-item" key={num}>
                    <img
                      src={`/img${num}.png`}
                      alt={`Gallery ${num}`}
                      className="gallery-img"
                    />
                    <div className="gallery-label">Team {num}</div>
                  </div>
                );
              })}
            </div>
          )}
        </div>
        <main className="main-content">
          {loading ? (
            <div className="loading">
              <p>Loading Olympic data...</p>
            </div>
          ) : error ? (
            <div className="error">
              <p>Error loading data: {error}</p>
            </div>
          ) : (
            <div className="olympic-data">
              <h2>üèÜ Olympic Champions</h2>
              <div className="data-grid">
                {olympicData.map((athlete, index) => (
                  <div key={index} className="athlete-card">
                    <div className="medal-count">
                      <span className="gold">ü•á {athlete.gold}</span>
                      <span className="total">üèÖ {athlete.medals}</span>
                    </div>
                    <h3>{athlete.name}</h3>
                    <p className="country">üá∫üá∏ {athlete.country}</p>
                    <p className="sport">‚öΩ {athlete.sport}</p>
                  </div>
                ))}
              </div>
              {/* Google Sheets Integration */}
              <div className="sheets-integration">
                <h2>üìä Connect Your Google Sheet</h2>
                <div className="auto-refresh-info">
                  <span className="auto-refresh-badge">üîÑ Auto-refresh every 30 seconds</span>
                </div>
                <div className="url-input-container">
                  <input
                    type="text"
                    placeholder="Enter your Google Sheets URL here..."
                    value={sheetUrl}
                    onChange={(e) => setSheetUrl(e.target.value)}
                    className="url-input"
                  />
                  <button
                    onClick={() => setShowGoogleSheets(true)}
                    className="connect-btn"
                    disabled={!sheetUrl.trim()}
                  >
                    üîó Connect Sheet
                  </button>
                </div>
                {showGoogleSheets && (
                  <GoogleSheetsData sheetUrl={sheetUrl} />
                )}
              </div>
            </div>
          )}
        </main>
      </div>
    </>
  );
}

export default App;
